function back(res) {
	let last_id = HISTORY.length - 2;
	let parameter = HISTORY[last_id].res;
	parameter.from_back = true;
	eval(HISTORY[last_id].function)(parameter);
	HISTORY.pop();
}
window.addEventListener('popstate', function () {
	let last_id = HISTORY.length - 2;
	let parameter = HISTORY[last_id].res;
	parameter.from_back = true;
	eval(HISTORY[last_id].function)(parameter);
	HISTORY.pop();
});
function generateBlobSVG(res) {
	let blob = new Blob([eval(res)], {type: 'image/svg+xml'});
	let url = URL.createObjectURL(blob);
	return url;
}
function render(res) {
	saveHistory({res : res.res,function:render.caller.name});

	let raw_slug = render.caller.name.replace("page","");
	let slug = raw_slug.split(/(?=[A-Z])/).join("-").toLowerCase();
	let title = raw_slug.split(/(?=[A-Z])/).join(" ").toLowerCase();
	try{
		const url = new URL(window.location);
		url.searchParams.set('page', slug);
		window.history.pushState({}, title, url);
	}catch(err){
		console.log("eror")
	}
	document.getElementById('root').innerHTML = res.view;
}
function saveHistory(res) {
	if (res.res.from_back) {

	}else{
		let respon = res.res || "";
		HISTORY.push({
			function : res.function,
			res : respon
		});
	}
}
function menuBottom(menu_aktif) {
	let item_menu = "";
	for (var i = 0; i < MENU.length; i++) {

		let icon_blob = "";
		if (MENU[i].id == menu_aktif) {
			icon_blob = MENU[i].icon_active;
		}else{
			icon_blob = MENU[i].icon;
		}

		let onclick = "";
		if(MENU[i].function){
			onclick = ` data-data='${JSON.stringify(MENU[i].id)}' onclick="${MENU[i].function}(this)"`;
		}
		let icon = `<img src="${icon_blob}"${onclick}>`;
		if (MENU[i].id == 3) {
			item_menu += `<div class="icon_menu home_menu">${icon}</div>`;
		}else{
			item_menu += `<div class="icon_menu">${icon}</div>`;
		}

	}
	let extra = ""
	if (menu_aktif == 0) {
		extra = " border-top"
	}
	let result = `
		<div class="menu_bottom${extra}"><div class="wrapper">${item_menu}</div></div>
	`;
	return result;
}
